-süstematiseerida ja parendada Tallinna ruumiandmete kogumist, pidamist, analüüsimist ning levitamist;
-olla kaasaegne, mitmeid infosüsteeme, kasutajaid ja andmesisestajaid üheaegselt teenindav register, muutes ruumiandmete kasutamise tsentraalselt hallatavaks, vältides andmete dubleerimist ja tagades kasutajatele ajakohaste andmete kättesaadavuse;
-võimaldada ruumiandmete vahetamist ja pakkuda ruumiandmetel põhinevaid teenuseid standardseid protokolle kasutades.

Andmekogu asutamise ja pidamise eesmärgid on:
1)	parendada ja kaasajastada Jõelähtme valla taotluste esitamise ja menetlemise protsessi;
2)	luua keskkond taotluste elektrooniliseks vastuvõtmiseks ja menetlemiseks;
3)	tõhustada Jõelähtme Vallavalitsuse sisest asjakohast infovahetust;
4)	võimaldada standardsete andmevahetusprotokollide abil vahetada andmekogu andmeid riigi andmekogudega;
5)	tagada Jõelähtme valla eelarvest antavate toetuste sihtotstarbelise kasutamise kontroll ja aruandlus;
6)	pidada arvestust esitatud taotluste ja taotlejatele antud toetuste üle.

Maksekäsu kiirmenetluse infosüsteem on maksekäsukeskuse elektrooniline töökeskkond, mille asutamise eesmärk on:
1) tagada ülevaade kohtu menetluses olevatest maksekäsu kiirmenetlustest;
2) kajastada andmeid maksekäsu kiirmenetluse käigus tehtud toimingute kohta;
3) võimaldada andmete ja dokumentide elektroonilist vastuvõtmist, edastamist ja säilitamist;
4) võimaldada andmete automatiseeritud kasutamist menetlusdokumentide koostamiseks;
5) võimaldada maksekäsuosakonna töö korraldamist;
6) tagada õiguspoliitiliste otsuste tegemiseks vajaliku kohtustatistika kogumine.

Registri asutamise ja kasutusele võtmise eesmärgiks on:
  1) Muhu vallas registreeritud koerte ja kasside üle arvestuse pidamine;
  2) Muhu vallas registreeritud koerte ja kasside kohta informatsiooni kogumine;
  3) Muhu vallas registreeritud koerte ja kasside kohta informatsiooni väljastamine;
  4) Muhu vallas registreeritud koerte ja kasside omanike kiire leidmine ja neile lemmiklooma tagastamine

