§ 2.   Andmekogu pidamise eesmärk

   Andmekogu pidamise eesmärgiks on:
  1) parendada ja kaasajastada Järva valla taotluste esitamise ja menetlemise protsessi;
  2) luua keskkond taotluste elektrooniliseks vastuvõtmiseks ja menetlemiseks;
  3) tõhustada ametiasutuse sisest asjakohast infovahetust;
  4) võimaldada standardsete andmevahetusprotokollide abil vahetada andmekogu andmeid riigi andmekogudega;
  5) tagada Järva valla eelarvest antavate toetuste sihtotstarbelise kasutamise kontroll ja aruandlus;
  6) pidada arvestust esitatud taotluste üle ja taotlejatele antud toetuste üle.

Registri pidamise eesmärgid on:
1) lemmikloomade üle arvestuse pidamine;
2) registreeritud loomade kohta informatsiooni kogumine ja väljastamine;
3) registreeritud järelevalveta loomade omanike kiire leidmine ja tagastamine omanikule;
4) loomatauditõrje seaduses nõutud vaktsineerimiste kontrollimine.

Karistusregistri pidamise eesmärk on:
1) usaldusväärse teabe andmine isiku karistusandmete kohta;
2) isiku teavitamine tema kohta registrisse kantud andmetest;
3) isiku karistusandmete vahetamine välisriigiga.

Andmekogu pidamise eesmärk on:
1) lihtsustada linnas tehtavate heakorra-, hooldus- ja haljastööde korraldamisega seotud protsesse, s.h hangete läbiviimist tööde teostajate leidmiseks ning tööde teostamise ja selle kvaliteedi üle arvestuse pidamiseks, koguda objektide kohta vajalikke andmeid ning vältida dubleerimist;
2) kaasata kodanikke üksiktööde vajadustest teavitamisse ning avalikkuse poolt edastatud heakorraprobleemide haldamiseks;
3) hõlbustada hooldus-, heakorra ja haljastusalaste hangete ettevalmistamist, objektide üle arvestuse pidamist, kaebustega tegelemist;
4) pidada arvestust hooldusobjektide tööde teostamise üle, lihtsustada tegevuste üle teostatavat järelevalve, sealhulgas kvaliteedi hindamist ja aruannete tegemist.

Pärnu linna plaanide ja kaardistuste infosüsteem on kohaliku omavalitsuse andmekogu, mille eesmärk on:
1) arvestuse pidamine Pärnu linna erinevates mõõtkavades graafilise info üle;
2) graafilise teabe saamise võimaldamine;
3) teiste Pärnu linna andmekogude digitaalse graafilise alusbaasiga varustamine.

Pärnu linna kohanimede infosüsteem on kohaliku omavalitsuse andmekogu, mille asutamise ja kasutuselevõtmise eesmärk on:
1) arvestuse pidamine Pärnu linna territooriumil asuvate kohanimede üle;
2) teabe saamise võimaldamine kohanimede kohta;
3) Pärnu linnavalitsuse struktuuriüksuste ja teiste asjast huvitatud isikute varustamine kohanime andmetega.

Kalmisturegister asutatakse kalmistuseadusega kalmistu haldajale pandud ülesannete täitmiseks, sealhulgas Kohtla-Järve  linna hallatava ning matmiseks avatud Raudi kalmistu (edaspidi kalmistu) hauaplatside, nendele maetute ja hauaplatside kasutajate andmete kogumiseks ning kalmistu kasutamise ja haldamise korraldamiseks vajalike andmete töötlemiseks.
Kalmisturegistri pidamise eesmärgid on:
 1) süstematiseerida kalmistul asuvate hauaplatside ja nende kasutamisega seotud andmeid ning parendada avalike ülessannete täitmiseks nende kasutamise ja analüüsimise võimalusi;
 2) võimaldada  kalmistu kasutamise ja haldamise korraldamisel elektroonilist asjaajamist ja teabevahetust;
 3) avalikustada kalmistu ja maetute andmed  internetis vastava veebilehe (edaspidi kalmistuportaal) kaudu.

Register on kohaliku omavalitsuse andmekogu, mille asutamise ja kasutamisele võtmise eesmärgid on:
1) arvestuse pidamine jäätmevaldajate kohta;
2) arvestuse pidamine jäätmevedajate kohta;
3) arvestuse pidamine jäätmetekkekohtade (jäätmevaldaja elu- või tegevuskoht), jäätmemahutite, jäätmeliikide ja kohta;
4) Haapsalu Linnavalitsuse varustamine eelpool nimetatud informatsiooniga jäätmehoolduse kavandamiseks, korraldamiseks ja järelevalve teostamiseks.

1) Rapla valla haldusterritooriumil jäätmeseaduse alusel korraldatud jäätmeveoga liitumisele kuuluvate hoonestatud maaüksuste jäätmetekkekohtade andmete haldamine;
2) hoonestatud maaüksuse jäätmetekkekohaga seotud jäätmevaldajate andmete haldamine;
3) Rapla valla haldusterritooriumil korraldatud jäätmeveoga tegeleva jäätmevedaja andmete haldamine;
4) eespool nimetatud andmete kasutamine jäätmehoolduse kavandamise, korraldamise ja järelevalve teostamiseks.

1.	parandada Euroopa Sotsiaalfondist (edaspidi ESF) rahastatavate tegevuste raames kohustusliku andmekorje  andmete kvaliteeti;
2.	võimaldada ESF-ist rahastatud projektide toetuse saajatel ning tegevuste korraldajatel täita riikliku ülesande täitmist ning kontrollida osalejate vastavust riiklikest registritest (registri järgmised arendusetapid);
3.	vähendada ESF-ist rahastatud projektide toetuse saajate ja tegevuste korraldajate aruandlusele kuluvat aega võttes ESF andmekorje ja osalejate nõuetele vastavuse kontrolli jaoks vajalikud andmed riiklikest registritest (esimeses arendusetapis X-tee liides rahvastikuregistri, struktuuritoetuste  registri ja äriregistriga. Järgmises etapis liidestatakse registrid vastavalt vajadusele ja volitusele teiste riiklike registritega);
4.	vähendada ESF-is rahastatud tegevuste adminsitratsiooniüksuste (rakendusüksuste) kontrollidele kuluvat aega.

Kalmistute registri asutamise peamised eesmärgid on:
1. süstematiseerida ja parendada kalmistute hauaplatside kasutamisega seotud andmete kogumist, pidamist, analüüsimist; 
2. kalmistute arhiivimaterjalide registrisse sisestamine ning andmetöötluse võimaldamine; 
3. matmiskohtade kasutusse andmise, haldamise ja taaskasutusse võtmise protsessi lihtsustamine; 
4. kaasaegse, mitmeid infosüsteeme, kasutajaid ja andmesisestajaid üheaegselt teenindava register loomine, muutes hauaplatside andmete haldamise tsentraalse registri põhiseks, vältides andmete dubleerimist ja tagades kasutajatele kõige värskema seisuga andmete kättesaadavuse; 
5. avalikustada kalmistute ajaloolist ja kultuurilist informatsiooni kalmistute veebi kaudu ja võimaldada kodanikele erinevate teenuste tellimine ; 
6. hauaplatside seostamine digitaalse kaardiga, mis võimaldab kasutajal kaardi abil lihtsamini üles leida otsitava hauaplatsi; 
7. võimaldada registri andmete vahetamist standardseid andmevahetusprotokolle kasutades teiste linna ning riigi andmekogudega

Infosüsteemi eesmärkideks on:
- ühendada ühtse haldussüsteemi külge kõik linna foorikontrollerid ja neid vajadusel juhtida, monitoorida, sisse/välja lülitada, muuta töörežiimi;
- juhtida Tallinna linna liiklusvooge nende monitoorimisel saadud andmeid kasutades eesmärgiga saavutada võimalikult sujuv, kiire ja takistusteta liiklus;
- tõhustada linna ametiasutuste sisest ja vahelist valdkondlikku infovahetust ning aruandlusprotsesse;
- kuvada (reaalajas) ja salvestada ristmikel asuvate liiklusjälgimiskaamerate videopilti;
- võimaldada vaadata ja järelvaate režiimis näha kaamerate pilti ühtsest keskkonnast liikluskoormuse, probleemide ja intsidentide hindamiseks.

Kohila valla taotluste esitamise ja menetlemise andmekogu eesmärk on:
1) parendada ja kaasajastada Kohila valla taotluste esitamise ja menetlemise protsessi;
2) luua keskkond taotluste elektrooniliseks vastuvõtmiseks ja menetlemiseks;
3) tõhustada vallavalitsuse sisest asjakohast infovahetust;
4) tagada Kohila valla eelarvest antavate toetuste sihtotstarbelise kasutamise kontroll ja aruandlus;
5) pidada arvestust esitatud taotluste ja taotlejatele antud toetuste üle.

Andmekogu pidamise eesmärgid on:
1) koondada nii Tallinna linna ametiasutuste tehtud või tellitud kui ka kavandatavad uuringud ja Raestipendiumi saajate uurimistööd ühtsesse andmekogusse;
2) saada uuringutest ülevaade ning säilitada nende andmed korrastatud kujul; 
3) parandada uuringute kättesaadavust ametiasutustele ja avalikkusele;
4) vältida topeltuuringute tegemist Tallinna omavalitsusüksuses;
5) aidata kaasa Tallinna linna rahvusvahelisele koostööle ja andmevahetusele ning kõrgkoolide ja teiste teadusasutuste ning kohalike omavalitsustega uuringute valdkonnas tehtavale koostööle ja andmevahetusele.

Register on kohaliku omavalitsuse andmekogu, mille asutamise ja kasutamisele võtmise eesmärgid on:
1) arvestuse pidamine jäätmevaldajate kohta;
2) arvestuse pidamine jäätmevedajate kohta;
3) arvestuse pidamine jäätmetekkekohtade (jäätmevaldaja elu- või tegevuskoht), jäätmemahutite, jäätmeliikide ja kohta;
4) varustamine eelpool nimetatud informatsiooniga jäätmehoolduse kavandamiseks, korraldamiseks ja järelevalve teostamiseks.

Kalmistute registri asutamise peamised eesmärgid on:
1. süstematiseerida ja parendada Tallinna kalmistutel asuvate hauaplatside kasutamisega seotud andmete kogumist, pidamist, analüüsimist;
2. kalmistute arhiivimaterjalide registrisse sisestamine ning andmetöötluse võimaldamine;
3. matmiskohtade kasutusse andmise, haldamise ja taaskasutusse võtmise protsessi lihtsustamine;
4. luua kaasaegne, mitmeid infosüsteeme, kasutajaid ja andmesisestajaid üheaegselt teenindav register, muutes hauaplatside andmete haldamise tsentraalse registripõhiseks, vältides andmete dubleerimist ja tagades kasutajatele kõige värskema seisuga andmete kättesaadavus;
5. hauaplatside hooldusteenuse tellimise võimaldamine riigiportaali vahendusel;
6. hauaplatside seostamine digitaalse kaardiga võimaldab kasutajal kaardi abil lihtsamini üles leida otsitava hauaplatsi
7. võimaldada registri andmete vahetamist standardseid andmevahetusprotokolle kasutades teiste linna ning riigi andmekogudega.

Registri pidamise eesmärk on:
1) lemmikloomade (edaspidi loom) üle arvestuse pidamine;
2) registreeritud loomade kohta informatsiooni kogumine ja väljastamine;
3) registreeritud järelevalveta loomade omanike kiire leidmine ja tagastamine omanikule;
4) loomatauditõrje seaduses nõutud vaktsineerimiste kontrollimine.

Kuusalu vallas registreeritud koerte üle arvestuse pidamine ja väljastamine;
koerte kohta informatsiooni kogumine;
järelevalveta koerte omanike kiire leidmine ja koera tagastamine omanikule.

Nimemärgiste riikliku registri eesmärk on:
1) valmistajate ja sissevedajate nimemärgiste kohta andmete säilitamine;
2) registrisse kantud nimemärgiseid käsitleva teabe töötlemise võimaldamine;
3) esitatud nimemärgiste näidis- ja võrdlusjäljendite säilitamine;
4) väärismetalltootele kantud nimemärgise võrdlemise võimaldamine registris säilitatavate nimemärgise näidis- ja võrdlusjäljenditega.

1) Loksa Linnavalitsusele ja Loksa Linnavalitsuse hallatavatele asutustele saabunud ning asutuse poolt koostatud dokumentide haldamine;
 2) õigus- ja haldusaktide menetlemine, istungite ettevalmistamine ja läbiviimine;
 3) juurdepääsu tagamine avalikule teabele.

Registri pidamise eesmärgid on:
1) võimaldada vallavalitsusel korraldada rahvusvaheliselt tunnustatud põhimõtetest lähtuvat raamatupidamist ja finantsaruandlust;
2) tagada valla varade, kohustiste, tulude, kulude ja omakapitali asjakohane ning tõepäraselt esitatud arvestus;
3) teha kasutajatele kättesaadavaks tööülesannete täitmiseks vajalikud andmed.

Haridusameti vajadustest lähtudes on loodava infosüsteemi peamised eesmärgid: 
•	süstematiseerida ja parendada haridusameti ja haridusasutuste koostööd kvaliteetsemaks, kiiremaks ja tõhusamaks;
•	süstematiseerida ja parendada Tallinna laste, õpilaste ja haridustöötajatega seotud andmete kogumist, pidamist, analüüsimist;
•	luua kaasaegne, mitmeid infosüsteeme, kasutajaid ja andmesisestajaid üheaegselt teenindav infosüsteem, muutes haridusasutuste andmete kasutamine tsentraalselt hallatavaks, vältides andmete dubleerimist ja tagades kasutajatele kõige värskema seisuga andmete kättesaadavus;
•	luua töövahend, mis parandab tööd erinevate andmetega ning hõlbustab kommunikatsiooni erinevate osapoolte vahel;
•	parendada statistiliste andmete ja aruannete kättesaadavust; 
•	pakkuda registri baasil haridusega seotud e-teenuseid;
•	liidestada asutatav register teiste asjaomaste linna ja riigi andmekogudega standardseid andmevahetusprotokolle kasutades, mis muudab andmed kättesaadavaks ühest infosüsteemist.
Infosüsteem luuakse eesmärgiga kaotada ja ennetada olukord, kus haridusasutused sisestavad erinevatesse infosüsteemidesse dubleerivaid andmeid. Infosüsteemi üheks peamiseks eesmärgiks on ühildada olemasolevaid infosüsteeme, et lihtsustada haridusasutuste tööd. Hetkel täidavad haridusasutused kõrvuti mitut erinevat süsteemi, mille funktsioonid ja kogutavad andmed on üksteisele küllaltki sarnased, kuid erineva funktsionaalsusega. See põhjustab andmete erinevat kvaliteeti ning on tekitanud olukorra, kus haridusasutused peavad sama infot edastama erinevatele või isegi samadele isikutele või samadesse süsteemidesse mitu korda. Riiklikud infosüsteemid on loodud registri haldaja keskselt, mitte infosüsteemi kasutajate vajaduste järgi. Uus infosüsteem lihtsustaks eelkõige haridusasutuste tööd, kuna piisaks ühest korrast andmete sisestamiseks ja salvestamiseks.

§ 3.  Registri asutamise eesmärk
  Registri asutamise ja kasutusele võtmise eesmärgiks on:
 1) arvestuse pidamine jäätmevaldajate üle;
 2) arvestuse pidamine jäätmetekkekohtade (jäätmevaldaja elu- või tegevuskoht) üle;
 3) Kohtla-Järve Linnavalitsuse (edaspidi valitsus) varustamine eespool nimetatud informatsiooniga jäätmehoolduse kavandamise, korraldamise ja järelevalve tegemiseks ning jäätmeseadusega kohalikule omavalitsusele jäätmehoolduse korraldamiseks sätestatud ülesannete täitmiseks.

Andmekogu pidamise eesmärk on:
1) koondada ja hallata teavet Tallinna linna õigusaktide ning nende eelnõude kohta;
2) luua linna töötajatele ja ametnikele (edaspidi koos teenistujad) õigusaktide koostamise ja menetlemise keskkond ning teha neile interneti teel kättesaadavaks tööülesannete täitmiseks vajalik teave ja andmed;
3) kaasata avalikkust Tallinna linna õigusaktide koostamisse ja avalikustada vastuvõetud õigusaktid interneti teel;
4) hallata teavet linnavolikogu, linnavalitsuse, linnaosadekogude ja nende komisjonide töö ja koosseisude kohta.

1) isikustamata andmete kogumise kaudu sõidunõudluse määramiseks ja liinivõrgu optimeerimiseks; 
2) isikustamata andmete kogumise kaudu sõidupiletite müügiks;
3) isikustatud  andmete kogumise kaudu sõidupiletite kontrolliks;
4) isikustatud  andmete kogumise kaudu ühistranspordi sõidusoodustuste andmiseks;
5) isikustamata andmete kogumise kaudu omavalitsuste vahelise ühistransporditeenuse tulude ja kulude tasaarveldamiseks.

